"use strict";(self.webpackChunkblog=self.webpackChunkblog||[]).push([[18939],{65039:(e,o,r)=>{r.r(o),r.d(o,{default:()=>s});var t=r(78e3);const a=[(0,t.uE)('<h1 id="venta-de-productos-por-proveedor" tabindex="-1"><a class="header-anchor" href="#venta-de-productos-por-proveedor" aria-hidden="true">#</a> <strong>Venta de Productos por Proveedor</strong></h1><p>Seleccione en el menú de ADempiere, la carpeta &quot;<strong>Gestión de Ventas</strong>&quot;, luego seleccione la carpeta &quot;<strong>Facturas de Ventas</strong>&quot;, por último seleccione la carpeta &quot;<strong>Consulta de Facturas</strong>&quot;. Finalmente, seleccione el reporte &quot;<strong>Venta de Productos por Proveedor</strong>&quot;.</p><p><img src="/assets/img/docs/lve/report/resources/report-menu-sale-of-products-by-supplier.png" alt="menú de reporte venta de productos por proveedor"></p><p>Imagen 1. Menú de ADempiere</p><p>Podrá visualizar la ventana del reporte &quot;<strong>Venta de Productos por Proveedor</strong>&quot;, con diferentes campos que permiten filtrar la búsqueda de información en base a lo requero por el usuario.</p><p><img src="/assets/img/docs/lve/report/resources/window-of-the-report-sale-of-products-by-supplier.png" alt="ventana del reporte venta de productos por proveedor"></p><p>Imagen 2. Ventana del Reporte Venta de Productos por Proveedor</p><p>Seleccione en el campo &quot;<strong>Almacén</strong>&quot;, el almacén por el cual requiere filtrar la búsqueda de información.</p><p><img src="/assets/img/docs/lve/report/resources/warehouse-field-of-the-report-window-sale-of-products-by-supplier.png" alt="campo almacén de la ventana del reporte venta de productos por proveedor"></p><p>Imagen 3. Campo Almacén</p><p>Seleccione en el campo &quot;<strong>Socio del Negocio</strong>&quot;, el socio del negocio por el cual requiere filtrar la búsqueda de información.</p><p><img src="/assets/img/docs/lve/report/resources/business-partner-field-of-the-report-window-sale-of-products-by-supplier.png" alt="campo socio del negocio de la ventana del reporte venta de productos por proveedor"></p><p>Imagen 4. Campo Socio del Negocio</p><p>Seleccione en el campo &quot;<strong>Producto</strong>&quot;, el producto por el cual requiere filtrar la búsqueda de información.</p><p><img src="/assets/img/docs/lve/report/resources/product-category-field-of-the-report-window-sale-of-products-by-supplier.png" alt="campo producto de la ventana del reporte venta de productos por proveedor"></p><p>Imagen 5. Campo Producto</p><p>Seleccione en el campo &quot;<strong>Categoría del Producto</strong>&quot;, la categoría del producto por el cual requiere filtrar la búsqueda de información.</p><p><img src="/assets/img/docs/lve/report/resources/product-class-field-of-the-report-window-sale-of-products-by-supplier.png" alt="campo categoría del producto de la ventana del reporte venta de productos por proveedor"></p><p>Imagen 6. Campo Categoría del Producto</p><p>Seleccione en el campo &quot;<strong>Clase de Producto</strong>&quot;, la clase de producto por el cual requiere filtrar la búsqueda de información.</p><p><img src="/assets/img/docs/lve/report/resources/product-classification-field-of-the-report-window-sale-of-products-by-supplier.png" alt="campo clase de producto de la ventana del reporte venta de productos por proveedor"></p><p>Imagen 7. Campo Clase de Producto</p><p>Seleccione en el campo &quot;<strong>Grupo de Producto</strong>&quot;, el grupo de producto por el cual requiere filtrar la búsqueda de información.</p><p><img src="/assets/img/docs/lve/report/resources/product-group-field-of-the-report-window-product-sales-by-supplier.png" alt="campo grupo de producto de la ventana del reporte venta de productos por proveedor"></p><p>Imagen 8. Campo Grupo de Producto</p><p>Seleccione en el campo &quot;<strong>Clasificación de Producto</strong>&quot;, la clasificación de producto por el cual requiere filtrar la búsqueda de información.</p><p><img src="/assets/img/docs/lve/report/resources/product-classification-field-of-the-report-window-sale-of-products-by-supplier.png" alt="campo clasificación de producto de la ventana del reporte venta de productos por proveedor"></p><p>Imagen 9. Campo Clasificación de Producto</p><p>Seleccione en el campo &quot;<strong>Fecha de Facturación</strong>&quot;, el rango de fecha por el cual requiere filtrar la búsqueda de información.</p><p><img src="/assets/img/docs/lve/report/resources/check-sales-transactions-of-the-report-window-sale-of-products-by-supplier.png" alt="campo fecha de facturación de la ventana del reporte venta de productos por proveedor"></p><p>Imagen 10. Campo Fecha de Facturación</p><p>Indique en el campo &quot;<strong>Entrega Directa</strong>&quot;, si requiere filtrar la búsqueda de información por entrega directa.</p><p><img src="/assets/img/docs/lve/report/resources/option-ok-in-the-window-of-the-report-sale-of-products-by-supplier.png" alt="campo entrega directa de la ventana del reporte venta de productos por proveedor"></p><p>Imagen 11. Campo Entrega Directa</p><p>El check &quot;<strong>Transacciones de Venta</strong>&quot;, permite filtrar la búsqueda de información por transacciones de venta.</p><p><img src="/assets/img/docs/lve/report/resources/check-sales-transactions-of-the-report-window-sale-of-products-by-supplier.png" alt="check transacciones de venta de la ventana del reporte venta de productos por proveedor"></p><p>Imagen 12. Check Transacciones de Venta</p><p>Seleccione la opción &quot;<strong>OK</strong>&quot;, para generar el reporte en base a lo seleccionado anteriormente.</p><p><img src="/assets/img/docs/lve/report/resources/option-ok-in-the-window-of-the-report-sale-of-products-by-supplier.png" alt="opción ok de la ventana del reporte venta de productos por proveedor"></p><p>Imagen 13. Opción OK</p><p>Podrá vizualizar de la siguiente manera el reporte &quot;<strong>Venta de Productos por Proveedor</strong>&quot;.</p><p><img src="/assets/img/docs/lve/report/resources/report-sale-of-products-by-supplier.png" alt="reporte venta de productos por proveedor"></p><p>Imagen 14. Reporte Venta de Productos por Proveedor</p>',43)],p={},s=(0,r(13860).Z)(p,[["render",function(e,o){return(0,t.wg)(),(0,t.iD)("div",null,a)}]])},64936:(e,o,r)=>{r.r(o),r.d(o,{data:()=>t});const t=JSON.parse('{"key":"v-5db40704","path":"/docs/lve/report/sale-of-products-by-supplier.html","title":"Venta de Productos por Proveedor","lang":"es-ES","frontmatter":{"title":"Venta de Productos por Proveedor","icon":"app","category":["Localización Venezuela"],"star":9,"sticky":9,"tag":["Reportes de ADempiere"],"article":false,"summary":"Venta de Productos por Proveedor ==================================== Seleccione en el menú de ADempiere, la carpeta \\"Gestión de Ventas\\", luego seleccione la carpeta \\"Facturas de V","head":[["meta",{"property":"og:url","content":"https://ayuda.solopapp.com/docs/lve/report/sale-of-products-by-supplier.html"}],["meta",{"property":"og:title","content":"Venta de Productos por Proveedor"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:updated_time","content":"2023-06-29T22:12:23.000Z"}],["meta",{"property":"og:locale","content":"es-ES"}],["meta",{"property":"article:tag","content":"Reportes de ADempiere"}],["meta",{"property":"article:modified_time","content":"2023-06-29T22:12:23.000Z"}]]},"excerpt":"","headers":[],"git":{"createdTime":1687290742000,"updatedTime":1688076743000,"contributors":[{"name":"tecnicoerp","email":"134967453+tecnicoerp@users.noreply.github.com","commits":2}]},"readingTime":{"minutes":2.62,"words":785},"filePathRelative":"docs/lve/report/sale-of-products-by-supplier.md","localizedDate":"20 de junio de 2023"}')}}]);